                {
                    { new Guid("22aa3ffd-01fe-7f47-94bb-b5d6f041654f"), "Zalew Borków, 26-021 Borków", false, "Borków to ponad 36-hektarowy zbiornik położony w pięknej okolicy. Jego średnia głębokość nie przekracza 2 m, choć zdarzają się miejsca ponad 4-metrowe. Bujna roślinność wodna powodują, że ryby są trudne do przechytrzenia. Cały zbiornik jest zarośnięty, a powierzchnię wody urozmaicają dwie wyspy. Znajdziemy tu dwa duże pomosty, które można wykorzystać wędkarsko. Najwygodniej wędkuje się tu jednak z jednostki pływającej. Można wtedy znaleźć odcinki wody wolnej od roślin. W zbiorniku występują płocie, karpie, amury i liny. Poławiane są na spławik z pomostów lub na lekki grunt. Karpiarze mogą liczyć na branie ładnego karpia po uprzednim przygotowaniu i zanęceniu łowiska. Skuteczne są wszystkie popularne przynęty, takie jak kukurydza, białe i czerwone robaki oraz połówki rosówek. Z drapieżników występują tu szczupaki, choć przeważają małe ryby. Można połowić również okoni. Zarówno okonie, jak i szczupaki dobrze reagują na lekkie wahadłówki, białe lub różowe gumki i małe dżerki. Niektórzy łowią na żywca z brzegu i z łódek. Najlepsze efekty są na pograniczu czystej i zarośniętej wody. Zimą spod lodu można połowić niedużych okoni, a w cieplejsze dni uaktywniają się płocie.", 50.772772000000003, 20.756415000000001, 36.0, "Zalew w Borkowie", "Nizinna" },
                    { new Guid("23e8b16c-7c2c-13a4-557d-7d1aa32d4a23"), "Jaśle - Stawik, 26-140 Łączna ", false, "Jest to niewielki zbiornik na rzeczce w miejscowości Jaśle. Żyją w nim ładne ryby. Cisza nad wodą dopełnia wędkarskiego szczęście. Głębokość akwenu wynosi od około 1 m przy wpływie rzeczki do ponad 4 m przy wypływie. W połowie zbiornika znajduje się betonowy pomost, który można wykorzystać do celów wędkarskich. W jego pobliżu zawsze kręcą się drapieżniki. Zbiornik ma dopiero kilka lat, mimo to można spotkać tu różne gatunki ryb. Japońce, karpie, liny, płocie, jazie gwarantują zajęcie dla wędkarzy z lekką gruntówką bądź spławikówką. Zestaw ze spławikiem można usytuować zaraz za trzcinami. Ryby przebywają tam chętnie z powodu dużej ilości pokarmu. Większość białorybu bardzo dobrze bierze na kukurydzę. Aby zwiększyć swoje szanse, niektórzy wędkarze nęcą łowisko kilka dni przed planowaną wyprawą. Z drapieżników możemy się spodziewać szczupaków i okoni. Szczupaki lubią duże obrotówki bądź wahadłówki. Białym twisterem też można dobrze połowić. Na okonie nie wybieram się bez motor oil. Większe osobniki bywają kapryśne. Jednego dnia biorą dobrze, a następnego nie reagują na nic. ", 51.001476608965859, 20.775563090091644, 4.5, "Zbiornik Jaśle", "Nizinna" },
                    { new Guid("29aa3ffd-02fe-4f47-93bb-b4d9f041654f"), "Dawidowicza 3, 26-130 Suchedniów", true, "Zalew o powierzchni lustra wody bliskiej 22 ha położony na rzece Kamionce. Zbiornik znajduje się w centrum miasta sąsiadując z parkiem miejskim. Charakterystyczną cechą tego zbiornika jest wyspa położona na środku zbiornika stanowiąca rezerwat ptactwa wodnego i chronionych gatunków zwierząt. Głębokość zbiornika jest niewielka, a dno jest w większości muliste. Przy zalewie działa Ośrodek Sportu i Rekreacji (OSiR), gdzie jest do dyspozycji baza noclegowa, kąpielisko z kilkunastometrową plażą, kort tenisowy, boisko do gry w siatkę plażową oraz wiele innych atrakcji. Zalew jest łowny z każdego miejsca, a wędkarze nie narzekają na efekty. Zbiornik słynie z dużych okazów karpi, amurów, sandaczy. Jest również dużo leszcza, lecz w większości skąpych rozmiarów, ale trafiają się i okazy w granicach 60 cm. Złowimy tu również obie odmiany karasia, płocie, wzdręgi, jazie, liny, okonie i sandacze. ", 51.045213099999998, 20.844063800000001, 22.0, "Zalew w Suchedniowie", "Nizinna" },
                    { new Guid("29ab1fad-02fe-4f47-93bb-b4d9f041654f"), "Zalew Morawica, 26-026 Morawica", false, "Wody gminy Morawica to idealny teren na wyprawy z wędką. Na jej terenie znajduje się kilka ciekawych łowisk wędkarskich jak rzeka Czarna Nida czy wkrótce oddany do użytku publicznego zbiornik retencyjno-rekreacyjny na rzece Morawka. Wędkarze mogą złowić w tych wodach: bolenia, jazia, świnkę, występuje tu także sandacz, płoć, okoń oraz sporadycznie inne gatunki. Wody Zalewu zarybione zostały tołpygą, karpiem, leszczem, amurem, linem i karasiem. Występuję także płoć, okoń, szczupak oraz inne gatunki ryb. W opinii miejscowych wędkarzy łowiska te są niezwykle atrakcyjnym kąskiem. Wody te są dostępne dla członków Polskiego Związku Wędkarskiego zrzeszonych w Kole Polskiego Związku Wędkarzy w Morawicy, któremu przewodniczy Janusz Sokalski. Inni sympatycy wędkarstwa, osoby niezrzeszone w Kole, a także cudzoziemcy mogą wędkować w gminie Morawica po wykupieniu odpowiednich zezwoleń.", 50.746738399999998, 20.631227200000001, 7.2000000000000002, "Zalew Morawica", "Nizinna" },
                    { new Guid("64aa1fad-02fe-4f47-93bb-b4d9f041654f"), "Zalew Cedzyna, 26-008 Górno", false, "Zalew ten położony jest na rzece Lubrzanka. Powierzchnia zbiornika wynosi około 55 ha. Jest on ciekawy ze względu na ukształtowanie linii brzegowej, która jest dosyć zróżnicowana oraz są dwie zatoczki. Każdy wędkarz znajdzie coś dla siebie. Z wędkarskiego punktu widzenia można fajnie połowić zarówno od strony miejscowości Leszczyny, jak i Woli Kopcowej. Koryto rzeki Lubrzanki biegnie praktycznie środkiem zbiornika. Jeżeli chodzi o głębokość zbiornika to jest ona na jego większej części taka sama i wynosi od jednego metra do trzech lub czterech. Głębokość zwiększa się wraz z odległością tzn. schodzi ona coraz niżej od linii brzegowej do koryta gdzie osiąga pięć, sześć metrów. Głębiej jest też przy tamie oraz wałach. Jest też kilka dołków. Charakterystyka dna jest raczej przewidywalna, można powiedzieć, że jest to blat z dołkami.", 50.873173600000001, 20.732265000000002, 55.0, "Zalew Cedzyna", "Nizinna" }
                });

